import React from "react";
import Text from "./Text";

const App = () => {
  return (
    <React.Fragment>
      <h1>Hi, I am React </h1>
      <Text name="Ahmad" />
      <Text name="Homam" />
    </React.Fragment>
  );
};
export default App;
